  return (<>
    <Nav />
    <span className="text-capitalize"><Navigation navigation={"Edit Profile"} nav={
      <span className="text-l">{JSON.parse(localStorage.getItem('user-info')).email}</span>
    }/>
    </span>

    <Username/>

  </>);
}
